import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    state = {
        listings: []
    }

    componentDidMount()
    {
        var text;
        
        fetch(raw)
            .then(r => r.text())
            .then(text => {
                console.log('text decoded:', text);
            });
        
        if (typeof text === 'string') {
            const listings = text.split('\n');
        }
        else {
            const listings = "nothing";
        }
        console.log(listings);
        this.setState({ listings });

    }

    render()
    {
        return (

            <ul>
                {
                    this.state.listings
                        .map(listing =>
                            <li key={listing.FirstName}>{listing.LastName}</li>
                        )
                }
            </ul>
        );
    }


}
